INSERT INTO `table_baiviet` (`id`, `id_cat`, `id_list`, `id_item`, `id_sub`, `type`, `noibat`, `photo`, `thumb`, `ten_vi`, `masp`, `tenkhongdau`, `title`, `keywords`, `description`, `des_char`, `is_noindex`, `giaban`, `giacu`, `mota_vi`, `noidung_vi`, `name_vi`, `name_en`, `ten_en`, `mota_en`, `noidung_en`, `ten_cn`, `mota_cn`, `noidung_cn`, `stt`, `hienthi`, `ngaytao`, `ngaysua`, `luotxem`) VALUES
(65, 0, 0, 0, 0, 'huongdan', 1, 'aothunhalloween4-6733.jpg', 'aothunhalloween4-6733_250x200.jpg', 'Giới thiệu mô hình', '', 'gioi-thieu-mo-hinh', '', '', '', 0, 0, 0, 0, '', '', '', '', '', '', '', '', '', '', 1, 1, 1459909998, 0, 0),
(66, 0, 0, 0, 0, 'huongdan', 1, 'he4-8938.jpg', 'he4-8938_250x200.jpg', 'Chính sách bảo mật', '', 'chinh-sach-bao-mat', '', '', '', 0, 0, 0, 0, 'Thông tin cá nhân của thành viên trên International được International cam kết bảo mật tuyệt đối theo chính sách bảo vệ thông tin cá nhân của International.', '<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 21px; font-family: arial; color: rgb(0, 0, 0);\"><strong style=\"box-sizing: border-box;\">Cam kết bảo mật thông tin cá nhân khách hàng</strong></p>\r\n\r\n<ol style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; list-style: lower-roman; color: rgb(0, 0, 0); font-family: arial; font-size: 14px; line-height: 21px;\">\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit;\">Thông tin cá nhân của thành viên trên International được International cam kết bảo mật tuyệt đối theo chính sách bảo vệ thông tin cá nhân của International. Việc thu thập và sử dụng thông tin của mỗi thành viên chỉ được thực hiện khi có sự đồng ý của khách hàng đó trừ những trường hợp pháp luật có quy định khác.</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit;\">Không sử dụng, không chuyển giao, cung cấp hay tiết lộ cho bên thứ 3 nào về thông tin cá nhân của thành viên khi không có sự cho phép đồng ý từ thành viên.</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit;\">Trong trường hợp máy chủ lưu trữ thông tin bị hacker tấn công dẫn đến mất mát dữ liệu cá nhân thành viên, International sẽ có trách nhiệm thông báo vụ việc cho cơ quan chức năng điều tra xử lý kịp thời và thông báo cho thành viên được biết.</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit;\">Bảo mật tuyệt đối mọi thông tin giao dịch trực tuyến của thành viên bao gồm thông tin hóa đơn kế toán chứng từ số hóa trên International.</li>\r\n	<li style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit;\">Ban quản lý International yêu cầu các cá nhân khi đăng ký/mua hàng là Thành viên, phải cung cấp đầy đủ thông tin cá nhân có liên quan như: Họ và tên, địa chỉ liên lạc, email, số chứng minh nhân dân, điện thoại, số tài khoản, số thẻ thanh toán …., và chịu trách nhiệm về tính pháp lý của những thông tin trên. Ban quản lý International  không chịu trách nhiệm cũng như không giải quyết mọi khiếu nại có liên quan đến quyền lợi của thành viên đó nếu xét thấy tất cả thông tin cá nhân của thành viên đó cung cấp khi đăng ký ban đầu là không chính xác.</li>\r\n</ol>\r\n', '', '', '', '', '', '', '', '', 1, 1, 1459910400, 0, 0),
(67, 0, 0, 0, 0, 'huongdan', 1, '07eb22ca7ea5fac25f891b0c2b04402d-5635.jpg', '07eb22ca7ea5fac25f891b0c2b04402d-5635_250x200.jpg', 'Hướng dẫn thanh toán', '', 'huong-dan-thanh-toan', '', '', '', 0, 0, 0, 0, '', '', '', '', '', '', '', '', '', '', 1, 1, 1459910415, 0, 0),
(68, 0, 0, 0, 0, 'huongdan', 1, 'gioitrehathanhduanhaudichupanhkhoedangbendaonhattannosom-9433.jpg', 'gioitrehathanhduanhaudichupanhkhoedangbendaonhattannosom-9433_250x200.jpg', 'Tư vấn thiết kế', '', 'tu-van-thiet-ke', '', '', '', 0, 0, 0, 0, '', '', '', '', '', '', '', '', '', '', 1, 1, 1459910430, 1467645199, 0),
(60, 0, 0, 0, 0, 'chinhsach', 1, 'iconsupport-3046.png', 'iconsupport-3046_110x105.png', 'Hỗ trợ khách hàng', '', 'ho-tro-khach-hang', '', '', '', 0, 0, 0, 0, 'Ấn Tượng Đẹp hỗ trợ khách hàng tối đa trong chính sách thanh toán cũng như bảo hành cho sản phẩm.', '<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">Quý khách có thể đặt mua hàng trực tuyến tại website Japana.vn thông qua các bước đơn giản sau</span></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"> </p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">1. Tìm kiếm sản phẩm.</span></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">Qúy khách có thể tìm sản phẩm theo 3 cách: </span></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">a. Gõ tên sản phẩm vào thanh tìm kiếm</span></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">b. Tìm theo danh mục</span></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">c. Tìm theo các sản phẩm mới nhất, bán chạy hoặc danh mục phổ biến trên từng ngành hàng</span></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">2. Thêm sản phẩm vào giỏ hàng.</span></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">Khi đã tìm được sản phẩm mong muốn, quý khách vui lòng bấm vào hình hoặc tên sản phẩm để vào được trang thông tin chi tiết của sản phẩm, sau đó:</span></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">a. Kiểm tra thông tin sản phẩm: giá, thông tin khuyến mãi. </span></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">b. Chọn số lượng mong muốn. </span></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">c. Thêm sản phẩm vào giỏ hàng.</span></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">3. Kiểm tra giỏ hàng.</span></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">Trong giỏ hàng thể hiện đầy đủ thông tin số lượng sản phẩm và tổng giá trị tiền hàng. Hiện tai Japana.vn chỉ giao hàng cho những đơn hàng có giá trị tối thiểu 200,000 vnđ. Nếu trong giỏ hàng Quý khách dưới 200,000 vnđ xin vui lòng chọn thêm sản phẩm.</span></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">Tại giỏ hàng Quý khách có thể chọn mua thêm sản phẩm khác hoặc chọn hủy một sản phẩm bất kỳ.</span></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">4. Điền thông tin địa chỉ giao nhận hàng.</span></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">Quý khách phải điền đầy đủ thông tin của người mua và nhận hàng, Japana cam kết sẽ giữ bí mật thông tin cá nhân của quý khách.</span></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">Trên cơ sở thông tin quý khách cung cấp, Japana sẽ tiến hành các thủ tục còn lại để giao hàng</span></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">5. Phương thức thanh toán.</span></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">Hiện tại Japana có các hình thức thanh toán cho khách hàng lực chọn:</span></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">- Thanh toán khi nhận hàng (COD) - Chỉ áp dụng khu vực Tp. Hồ Chí Minh<br style=\"margin: 0px; padding: 0px; box-sizing: border-box;\" />\r\n- Thanh toán qua tài khoản Ngân Hàng</span></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">Nếu các thông tin trên đã chính xác, quý khách vui lòng bấm \"Đặt Mua\", hệ thống sẽ bắt đầu tiến hành tạo đơn hàng dựa trên các thông tin quý khách đã đăng ký.</span></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">6.Kiểm tra và xác nhận đơn hàng.</span></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">Quý khách có thể vào email của mình (đã cung cấp cho Japana) để nhận thư xác nhận đặt hàng</span></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">7.Hoàn tất đơn hàng.</span></span></p>\r\n\r\n<p style=\"margin: 0px; padding: 0px; box-sizing: border-box; font-family: Helvetica, Arial, sans-serif; font-size: 12px; line-height: 21.6px; text-align: justify;\"><span style=\"font-size:14px;\"><span style=\"margin: 0px; padding: 0px; box-sizing: border-box; border: 0px; outline: 0px; vertical-align: baseline;\">Sau khi đơn hàng đã được xác nhận bằng email, bộ phận chăm sóc khách hàng của Japana (có thể) sẽ gọi điện trực tiếp cho quý khách hàng thông qua số điện thoại mà quý khách hàng đã cung cấp để xác nhận lại một lần nữa về đơn hàng.</span></span></p>\r\n', '', '', '', '', '', '', '', '', 1, 1, 1459844906, 0, 0),
(58, 0, 0, 0, 0, 'chinhsach', 1, 'iocntrans-3888.png', 'iocntrans-3888_110x105.png', 'Chính sách vận chuyển', '', 'chinh-sach-van-chuyen', '', '', '', 0, 0, 0, 0, 'Ấn Tượng Đẹp sẽ giao hàng cho khách hàng trong khoảng từ 01 đến 07 ngày làm việc kể từ khi nhận được đơn hàng của Quý khách. ', '<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 21px; font-family: arial; color: rgb(0, 0, 0);\">Thông thường <a href=\"http://www.shopby.vn/\" style=\"box-sizing: border-box; color: rgb(59, 59, 59); text-decoration: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; background: transparent;\">Shopby.vn</a>  sẽ giao hàng cho khách hàng trong khoảng từ 01 đến 07 ngày làm việc kể từ khi nhận được đơn hàng. Tuy nhiên, cũng có trường hợp việc giao hàng kéo dài hơn vài ngày làm việc, nhưng chỉ xảy ra trong những tình huống bất khả kháng như sau:</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 21px; font-family: arial; color: rgb(0, 0, 0);\">- Nhân viên <a href=\"http://www.shopby.vn/\" style=\"box-sizing: border-box; color: rgb(59, 59, 59); text-decoration: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: 1.6em; font-family: inherit; background: transparent;\">Shopby.vn</a> liên lạc với khách hàng qua điện thoại không được nên không thể giao hàng.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 21px; font-family: arial; color: rgb(0, 0, 0);\">- Địa chỉ giao hàng bạn cung cấp không chính xác hoặc không đầy đủ.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0p