(59, 0, 0, 0, 0, 'chinhsach', 1, 'iconchange-7770.png', 'iconchange-7770_110x105.png', 'Đổi trả hàng hóa', '', 'doi-tra-hang-hoa', '', '', '', 0, 0, 0, 0, 'hách hàng mua sản phẩm bằng hình thức đặt hàng online đề nghị giữ giấy giao nhận, hóa đơn để gửi lại cho Shopby.vn khi có yêu cầu đổi sản phẩm. ', '<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 21px; font-family: arial; color: rgb(0, 0, 0);\">Khách hàng mua sản phẩm bằng hình thức đặt hàng online đề nghị giữ giấy giao nhận, hóa đơn để gửi lại cho <a href=\"http://www.shopby.vn/\" style=\"box-sizing: border-box; color: rgb(59, 59, 59); text-decoration: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; background: transparent;\">Shopby.vn</a>  khi có yêu cầu đổi sản phẩm.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 21px; font-family: arial; color: rgb(0, 0, 0);\"><strong style=\"box-sizing: border-box;\">Điều kiện đổi trả sản phẩm</strong></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 21px; font-family: arial; color: rgb(0, 0, 0);\">- Sản phẩm phải còn nguyên vẹn, nguyên tem mác, chưa qua sử dụng và sửa chửa. Đối với sản phẩm có hộp phải còn nguyên hộp, đầy đủ phụ kiện, hướng dẫn đi kèm, tặng phẩm (nếu có).</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 21px; font-family: arial; color: rgb(0, 0, 0);\">- Sản phẩm đã nhận không quá 3 ngày.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 21px; font-family: arial; color: rgb(0, 0, 0);\">- Sản phẩm không mua trong thời gian khuyến mãi hoặc giảm giá.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 21px; font-family: arial; color: rgb(0, 0, 0);\">- Công ty chỉ chấp nhận đổi hàng miễn phí các trường hợp hàng bị lỗi, không đúng mẫu hoặc không đúng size hoặc bị hư hỏng trong quá trình vận chuyển. Các trường hợp khác quý khách liên hệ bộ phận chăm sóc khách hàng để được hướng dẫn.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 21px; font-family: arial; color: rgb(0, 0, 0);\">- Sản phẩm đổi trả phải có hóa đơn bán hàng kèm theo.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 21px; font-family: arial; color: rgb(0, 0, 0);\"><strong style=\"box-sizing: border-box;\">Hình thức đổi trả- hoàn tiền</strong></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 21px; font-family: arial; color: rgb(0, 0, 0);\">- Sản phẩm được đổi mới trong vòng từ 3 đến7 ngày. Khách hàng sẽ được đổi sản phẩm mới cùng loại nếu sản phẩm gặp sự cố không thể khắc phục được (do lỗi của nhà sản xuất). Nếu đổi khác loại sản phẩm đã mua, thì sản phẩm muốn đổi phải có giá bằng sản phẩm đã mua. Trong trường hợp đổi thấp hơn sản phẩm đã mua thì số tiền thừa chúng tôi sẽ không hoàn lại. Đối với trường hợp sản phẩm đổi hơn giá, người mua phải thanh toán thêm số tiền hơn đó.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 21px; font-family: arial; color: rgb(0, 0, 0);\">- Sản phẩm đổi trả khi bộ phận kinh doanh của <a href=\"http://www.shopby.vn/\" style=\"box-sizing: border-box; color: rgb(59, 59, 59); text-decoration: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; background: transparent;\">Shopby.vn</a> đã xác nhận về tình trạng sản phẩm, lỗi của sản phẩm.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 21px; font-family: arial; color: rgb(0, 0, 0);\">- Chúng tôi chỉ cho đổi sản phẩm này sang sản phẩm cùng loại hoặc khác loại. Trong trường hợp khách hàng không đồng ý thì có thể yêu cầu hoàn lại tiền. Số tiền hoàn lại sẽ bằng số tiền mà khách hàng đã bỏ ra mua sản phẩm. Tiền hoàn lại có thể bằng hình thức chuyển khoản hoặc nhận tiền mặt tại công ty.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 21px; font-family: arial; color: rgb(0, 0, 0);\"><strong style=\"box-sizing: border-box;\">Phí vận chuyển sản phẩm đổi trả</strong>  từ nơi khách hàng đến cửa hàng do khách hàng chi trả. Đối với trường hợp lỗi thuộc về phía công ty. Công ty sẽ chi trả toàn bộ phí vận chuyển đó</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 21px; font-family: arial; color: rgb(0, 0, 0);\"><strong style=\"box-sizing: border-box;\">Các trường hợp được đổi trả:</strong></p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 21px; font-family: arial; color: rgb(0, 0, 0);\">- Không đúng chủng loại, mẫu mã như quý khách đặt hàng.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 21px; font-family: arial; color: rgb(0, 0, 0);\">- Không đủ số lượng, không đủ bộ như trong đơn hàng.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 21px; font-family: arial; color: rgb(0, 0, 0);\">- Tình trạng sản phẩm bị ảnh hưởng như bong tróc, bể vỡ, rách… xảy ra trong quá trình vận chuyển,…</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 21px; font-family: arial; color: rgb(0, 0, 0);\">- Không đạt chất lượng như: quá hạn sử dụng, hết bảo hành, không vận hành được, hỏng hóc khách quan trong phạm vi bảo hành của nhà cung cấp, nhà sản xuất,…</p>\r\n\r\n<p style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 14px; line-height: 21px; font-family: arial; color: rgb(0, 0, 0);\">- Cam kết đổi sản phẩm nếu sản phẩm mà quý khách nhận được không thể sử dụng mà lỗi do nhà sản xuất hoặc lỗi do quá trình vận chuyển... Đề nghị khách hàng kiểm tra sản phẩm trước khi nhận hàng.<a href=\"http://www.shopby.vn/\" style=\"box-sizing: border-box; color: rgb(59, 59, 59); text-decoration: none; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; background: transparent;\">Shopby.vn</a> sẽ không nhận hoàn trả sản phẩm sau khi khách hàng đã kiểm tra và chấp nhận sản phẩm đó.</p>\r\n', '', '', '', '', '', '', '', '', 1, 1, 1459844835, 0, 0),
