(71, 0, 0, 0, 0, 'tintuc', 0, 'dribbblev0108-1200.png', 'dribbblev0108-1200_250x200.png', 'Ngông như Ibrahimovic: Muốn nhiều người ghét hơn', '', 'ngong-nhu-ibrahimovic-muon-nhieu-nguoi-ghet-hon', '', '', '', 0, 0, 0, 0, 'Trên trang mạng xã hội Instagram, siêu tiền đạo Ibrahimovic đăng tải dòng trạng thái đậm chất \"ngông\" khi tuyên bố muốn có nhiều người mới ghét mình hơn.', '<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\"><strong>Ngông như Ibrahimovic: Muốn nhiều người ghét hơn</strong></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Khi đã gần 35 tuổi, <strong>Zlatan Ibrahimovic</strong> vẫn quyết định cuộc phiêu lưu tại <a class=\"TextlinkBaiviet\" href=\"http://www.24h.com.vn/premier-league-2016-2017-c48e2367.html\" style=\"text-decoration: none; color: rgb(0, 0, 255);\" title=\"Premier League\">Premier League</a>, giải đấu hấp dẫn nhưng khắc nghiệt nhất hành tinh. Chân sút người Thụy Điển chọn MU vì ở đó có người thầy Jose Mourinho mà anh rất kính nể.</p>\r\n\r\n<p align=\"center\" style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0);\"><img -=\"\" alt=\"\" class=\"news-image\" i=\"\" ibrahimovic=\"\" mu:=\"\" n=\"\" src=\"http://image.24h.com.vn/upload/3-2016/images/2016-08-23/1471946989-ibra.jpg\" style=\"border: 0px; max-width: 400px;\" t=\"\" u=\"\" /></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 255); font-style: italic; text-align: center;\">Ibrahimovic có khởi đầu như mơ ở MU</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Tới Premier League, Ibrahimovic bị báo chí Anh quốc soi mói rất nhiều và nghi ngờ về khả năng thành công. Nhưng đẳng cấp của anh nhanh chóng lên tiếng để \"bịt miệng\" dư luận. Chỉ sau 3 trận chính thức trong màu áo MU, Ibrahimovic đã ghi tới 4 bàn.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Hiệu suất của Ibrahimovic quá kinh ngạc. Anh cho thấy khả năng hòa nhập rất nhanh với đội bóng mới, tạo mối quan hệ tốt đẹp với đồng đội. Ngay cả <a class=\"TextlinkBaiviet\" href=\"http://www.24h.com.vn/wayne-rooney-p366c48.html\" style=\"text-decoration: none; color: rgb(0, 0, 255);\" title=\"Rooney\">Rooney</a> cũng vui vẻ sẵn sàng nhường quyền đá penalty cho Ibrahimovic ở trận thắng Southampton 2-0.</p>\r\n\r\n<p align=\"center\" style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0);\"><img -=\"\" alt=\"\" class=\"news-image\" i=\"\" ibrahimovic=\"\" mu:=\"\" n=\"\" src=\"http://image.24h.com.vn/upload/3-2016/images/2016-08-23/1471946989-ibra1.jpg\" style=\"border: 0px; max-width: 400px;\" t=\"\" u=\"\" /></p>\r\n\r\n<p align=\"center\" style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 255); font-style: italic; text-align: center;\">Dòng trạng thái đầy chất \"ngông\"</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Mới đây trên trang mạng xã hội Instagram, cựu tiền đạo PSG xả giận với những anti-fan bằng cách đăng bức ảnh có nội dung đầy chất ngông: \"Tôi cần nhiều người mới ghét mình hơn nữa bởi những người ghét tôi trước đó giờ chuyển sang làm fan của tôi rồi\".</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Chỉ trong vòng chưa đầy 24 giờ sau khi đăng tải, bức ảnh này của Ibrahimovic đã thu hút đến hơn 716.000 lượt like (thích).</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\"><strong>12 năm, bàn thắng kinh điển đưa Ibrahimovic tới đỉnh cao</strong></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Ngày 22/8/2004 trên sân Amsterdam, Ibrahimovic ghi bàn thắng đẹp nhất cho Ajax và cũng là bàn thắng đẹp nhất trong sự nghiệp của anh vào lưới NAC Breda (6-2). Ibrahimovic khoác áo Ajax từ năm 2001 đến 2004, ra sân 74 lần và ghi 35 bàn thắng.</p>\r\n\r\n<p align=\"center\" style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0);\"><img -=\"\" alt=\"\" class=\"news-image\" i=\"\" ibrahimovic=\"\" mu:=\"\" n=\"\" src=\"http://image.24h.com.vn/upload/3-2016/images/2016-08-23/1471946989-ibra2.jpg\" style=\"border: 0px; max-width: 400px;\" t=\"\" u=\"\" /></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 255); font-style: italic; text-align: center;\">Ibrahimovic và bàn thắng kinh điển cho Ajax</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Điều đáng nói, Ibrahimovic lúc ấy bị nhiều CĐV của Ajax ghét bỏ vì bị cho đã làm Van der Vaart chấn thương và không thể ra sân ở trận gặp NAC Breda. Ibrahimovic đã thi đấu xuất sắc ở trận này, giúp đội bóng của Ronald Koeman đè bẹp NAC với tỉ số 6-2.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Nhưng vì mâu thuẫn sâu sắc với Van der Vaart, 9 ngày sau đó, Ibrahimovic đã rời Ajax để gia nhập <a class=\"TextlinkBaiviet\" href=\"http://www.24h.com.vn/su-kien/Juventus/\" style=\"text-decoration: none; color: rgb(0, 0, 255);\" title=\"Juventus\">Juventus</a> với giá 16 triệu euro. Đây là bước ngoặt lớn, nâng bước Ibra thành một trong những tiền đạo hay nhất lịch sử thế giới về sau.</p>\r\n', '', '', '', '', '', '', '', '', 1, 1, 1471952507, 1471965079, 0),
(72, 0, 0, 0, 0, 'tintuc', 0, 'chillseek-6805.png', 'chillseek-6805_250x200.png', 'Mourinho muốn tiếp tục “làm cách mạng” ở hàng thủ MU', '', 'mourinho-muon-tiep-tuc-lam-cach-mang-o-hang-thu-mu', '', '', '', 0, 0, 0, 0, 'Mặc dù đã đem về sân Old Trafford 4 bản hợp đồng chất lượng trong Hè này nhưng HLV Jose Mourinho vẫn muốn BLĐ MU chi thêm tiền để gia cố hàng phòng ngự của “Quỷ đỏ”.\r\n', '<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Sau Bailly, Ibrahimovic, Mkhitaryan và Pogba, cái tên thứ 5 mà Mourinho muốn chiêu mộ trong tham vọng phục hưng thời hoàng kim cho <strong>MU</strong> chính là nhà vô địch Euro, trung vệ người Bồ Đào Nha Jose Fonte (Southampton).</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Cầu thủ này hiện cũng đang là đội trưởng của đội chủ sân St. Mary’s và đội bóng của anh vừa thua chính “Quỷ đỏ” khi làm khách ở Old Trafford vòng 2 Ngoại hạng Anh.</p>\r\n\r\n<p align=\"center\" style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0);\"><img alt=\"Mourinho muốn tiếp tục “làm cách mạng” ở hàng thủ MU - 1\" class=\"news-image\" src=\"http://image.24h.com.vn/upload/3-2016/images/2016-08-23/1471917725-mu-5.jpg\" style=\"border: 0px; max-width: 400px;\" /></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 255); font-style: italic; text-align: center;\">Fabinho (ảnh to) và Jose Fonte (ảnh nhỏ, trên) có thể đến <a class=\"TextlinkBaiviet\" href=\"http://www.24h.com.vn/manchester-united-p721c48.html\" style=\"text-decoration: none; color: rgb(0, 0, 255);\" title=\"MU\">MU</a> trong khi Marcos Rojo nhiều khả năng sẽ phải chia tay \"Quỷ đỏ\"</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Theo The Sun, Mourinho định yêu cầu BLĐ<em> MU</em> chi ra 12 triệu bảng để thuyết phục Southampton bán Fonte cho họ. Trung vệ 32 tuổi người Bồ Đào Nha là mẫu cầu thủ mạnh mẽ và giàu kinh nghiệm với 4 năm chơi cho “The Saints”  có thể là mảnh ghép còn thiếu mà “Quỷ đỏ” đang tìm kiếm ở hàng thủ.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Hiện trung vệ có phong độ cao nhất MU mùa trước là Chris Smalling vẫn chưa có được nền tảng thể lực tốt nhất. Tân binh Eric Bailly hòa nhập khá nhanh nhưng đối tác với anh ở 2 trận vừa qua là Daley Blind bị đánh giá là không đủ chiều cao lý tưởng để chống bóng bổng và phán đoán tình huống tốt.</p>\r\n\r\n<p align=\"center\" style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0);\"><img alt=\"Mourinho muốn tiếp tục “làm cách mạng” ở hàng thủ MU - 2\" class=\"news-image\" src=\"http://image.24h.com.vn/upload/3-2016/images/2016-08-23/1471917725-mu-2.jpg\" style=\"border: 0px; max-width: 400px;\" /></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 255); font-style: italic; text-align: center;\">Blind không phải là mẫu trung vệ lí tưởng của MU</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Bên cạnh trung vệ Jose Fonte, Mourinho cũng đang nhắm chiêu mộ Fabinho (AS Monaco) để tăng cường khả năng phòng ngự vị trí hậu vệ phải của <u>MU</u>, phòng trường hợp Matteo Darmian và Phil Jones ra đi.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Cũng liên quan đến tình hình chuyển nhượng của MU là trường hợp của bộ đôi đang thất sủng dưới thời chiến lược gia người Bồ Đào Nha, hậu vệ Marcos Rojo và tiền vệ Bastian Schweinsteiger. Hiện Phó Chủ tịch điều hành “Quỷ đỏ” Ed Woodward dù khẳng định đội bóng của mình sẽ cắt giảm nhân sự nhưng chưa đảm bảo việc bất kỳ cầu thủ đội 1 nào của MU sẽ bị bán hoặc cho mượn.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Hiện Schweinsteiger vẫn tập cùng đội trẻ, còn Rojo đã từ chối Thượng Hải SIPG và đang được <a class=\"TextlinkBaiviet\" href=\"http://www.24h.com.vn/su-kien/monaco/\" style=\"text-decoration: none; color: rgb(0, 0, 255);\" title=\"Monaco\">Monaco</a> liên hệ nhưng đội bóng xứ Công quốc muốn MU cùng chia sẻ việc chi trả tiền lương cho cầu thủ người Argentina nếu thương vụ này hoàn tất.</p>\r\n', '', '', '', '', '', '', '', '', 1, 1, 1471952635, 1471965030, 0),
(73, 0, 0, 0, 0, 'tintuc', 1, 'boat01-8907.jpg', 'boat01-8907_250x200.jpg', 'Tin chuyển nhượng 23/8: Chelsea săn SAO Juventus', '', 'tin-chuyen-nhuong-238-chelsea-san-sao-juventus', '', '', '', 0, 0, 0, 0, 'Diego Costa đang chơi tốt nhưng HLV Conte vẫn muốn có thêm tiền đạo, và người đó là Mario Mandzukic.', '<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\"><strong>Chelsea săn tiền đạo Juventus</strong></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Diego Costa đã quyết định ở lại <a class=\"TextlinkBaiviet\" href=\"http://www.24h.com.vn/chelsea-p723c48.html\" style=\"text-decoration: none; color: rgb(0, 0, 255);\" title=\"Chelsea\">Chelsea</a> và đạt phong độ tốt đầu mùa. Nhưng HLV Conte chưa an tâm với 1 tiền đạo chất lượng trong tay. Thất bại ở thương vụ Romelu Lukaku khiến nhà cầm quân người Ý chuyển hướng sang cầu thủ đang bị thất sủng tại <a class=\"TextlinkBaiviet\" href=\"http://www.24h.com.vn/su-kien/Juventus/\" style=\"text-decoration: none; color: rgb(0, 0, 255);\" title=\"Juventus\">Juventus</a>, Mario Mandzukic. Hiện chân sút người Croatia đang được định giá chỉ khoảng 24 triệu bảng, mức giá chỉ bằng một phần ba so với số tiền Chelsea định bỏ ra để chiêu mộ Lukaku.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\"><strong>Sao Barca sẽ gia nhập Man City vào thứ Năm</strong></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Theo Sky Sports, thủ thành Claudio Bravo sẽ chia tay Barcelona và ký hợp đồng với Manchester City vào thứ Năm tuần này (25/8) sau khi hoàn tất buổi kiểm tra y tế. Nhà báo chuyên theo dõi tin chuyển nhượng bóng đá Tây Ban Nha, ông Guillem Balague cũng đã tiết lộ mức phí chuyển nhượng \"người gác đền\" người Chile này rơi vào khoảng 17 triệu bảng. Gia đình của Bravo cũng đã nói với bạn bè rằng họ sẽ chuyển đến Manchester sinh sống.</p>\r\n\r\n<p align=\"center\" style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0);\"><img alt=\"Tin chuyển nhượng 23/8: Chelsea săn SAO Juventus - 1\" class=\"news-image\" src=\"http://image.24h.com.vn/upload/3-2016/images/2016-08-23/1471927420-cn-1.jpg\" style=\"border: 0px; max-width: 400px;\" /></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 255); font-style: italic; text-align: center;\">Bravo sẽ gia nhập Man City trong ít ngày tới</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\"><strong>Everton không muốn giải cứu Joe Hart</strong></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Sau khi HLV Pep Guardiola (Man City) tuyên bố thẳng thừng Joe Hart có thể tùy ý chuyển đến CLB nào mà anh muốn như một động thái dọn đường đón Claudio Bravo cập bến Etihad từ Barca, Everton là một trong những CLB tỏ ý muốn có thủ thành số 1 của ĐT Anh.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Tuy nhiên, mới đây, tờ Daily Mail khẳng định đội chủ sân Goodison Park đã rút khỏi cuộc đua giành chữ ký của Joe Hart khi không đồng ý mức phí chuyển nhượng anh từ Man City là 7 triệu bảng vì cho rằng nó quá đắt. HLV Ronald Koeman của Everton còn chia sẻ ông vẫn tin tưởng vào tài năng của thủ môn Maarten Stekelenburg tại đội bóng của mình.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\"><strong>West Brom làm khó <a class=\"TextlinkBaiviet\" href=\"http://www.24h.com.vn/arsenal-p722c48.html\" style=\"font-size: 12px; text-decoration: none; color: rgb(0, 0, 255);\" title=\"Arsenal\">Arsenal</a> vụ Evans</strong></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Theo Express, West Brom đã yêu cầu Arsenal trả khoản phí chuyển nhượng 25 triệu bảng nếu muốn có trung vệ Jonny Evans. Cầu thủ 28 tuổi người Bắc Ailen từng có quãng thời gian dài 2006-2015 chơi cho MU - đại kình địch của chính \"Pháo thủ\" và nhiều fan Arsenal đã cảm thấy giận dữ khi biết tin HLV Arsene Wenger muốn mang anh về sân Emirates để vá lỗ hổng hàng thủ CLB.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\"><strong>Tottenham chèo kéo sao trẻ Barca</strong></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Tottenham đang có kế hoạch đưa tài năng trẻ Munir El Haddadi của Barcelona về với sân White Hart Lane. Cầu thủ chạy cánh 20 tuổi này không có nhiều cơ hội đá chính ở sân Nou Camp. Ngay cả khi Neymar vắng mặt do bận tham dự Olympic 2016 ở quê nhà Brazil, Munir vẫn phải ngồi dự bị.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Munir chỉ giữ vai phụ ở sân Nou Camp, nhưng lại là cầu thủ mà Tottenham thèm muốn. HLV Mauricio Pochettino hiện đang cần một cầu thủ đá cánh trái khéo léo, kỹ thuật và tài năng trẻ của Barcelona là lựa chọn phù hợp. Spurs sẵn sàng chi 13 triệu bảng để đưa Munir về với sân White Hart Lane. </p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\"><strong>Dante chia tay nước Đức</strong></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Trung vệ người Brazil, Dante đã chính thức chia tay Wolfsburg và nước Đức để gia nhập CLB của Pháp, Nice theo bản hợp đồng 3 năm. Cầu thủ này từng có nhiều năm chơi bóng trong màu áo Monchengladbach, Bayern Munich và Wolfsburg.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\"><strong>Arsenal hết hy vọng có Mustafi</strong></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Trước những tin đồn về việc Arsenal đang hỏi mua trung vệ Mustafi, hay Barca liên hệ tiền đạo Alcacer, BLĐ cũng như HLV trưởng Valencia đã lên tiếng phủ nhận và tuyên bố bộ đôi này không phải để bán.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Pako Ayestaran, HLV trưởng của Valencia khẳng định: \"Mustafi sẽ vẫn ở lại CLB. Cậu ấy không đi đâu cả. Tương tự là trường hợp của Alcacer. Chủ tịch CLB đã nói với tôi như vậy và tôi tin tưởng vào điều đó. Bộ đôi này là những trụ cột của chúng tôi và họ sẽ không bị đem bán.\"</p>\r\n', '', '', '', '', '', '', '', '', 1, 1, 1471952670, 1471965022, 0);
INSERT INTO `table_baiviet` (`id`, `id_cat`, `id_list`, `id_item`, `id_sub`, `type`, `noibat`, `photo`, `thumb`, `ten_vi`, `masp`, `tenkhongdau`, `title`, `keywords`, `description`, `des_char`, `is_noindex`, `giaban`, `giacu`, `mota_vi`, `noidung_vi`, `name_vi`, `name_en`, `ten_en`, `mota_en`, `noidung_en`, `ten_cn`, `mota_cn`, `noidung_cn`, `stt`, `hienthi`, `ngaytao`, `ngaysua`, `luotxem`) VALUES
(74, 0, 0, 0, 0, 'tintuc', 1, '64430-1969.jpg', '64430-1969_290x290.jpg', 'Chelsea thắng như chẻ tre: Hay không bằng... may', '', 'chelsea-thang-nhu-che-tre-hay-khong-bang-may', '', '', '', 0, 0, 0, 0, 'Có thể khẳng định, những chiến thắng hay quyết định thay đổi người của Antonio Conte kể từ đầu mùa không hoàn toàn xuất phát từ lí do chuyên môn.\r\n', '<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Cùng với MU, Man City và Hull, <strong>Chelsea </strong>là đội bóng hiếm hoi toàn thắng sau hai vòng mở màn <a class=\"TextlinkBaiviet\" href=\"http://www.24h.com.vn/premier-league-2016-2017-c48e2367.html\" style=\"text-decoration: none; color: rgb(0, 0, 255);\" title=\"Premier League\">Premier League</a> 2016/17. Thế nhưng, khác với hai đội bóng thành Manchester, cái cách mà “The Blues” kiếm 3 điểm chẳng hề dễ dàng, thậm chí còn khiến NHM phải “thót tim”: Ghi 1 bàn từ chấm 11m, 3 bàn xuất hiện trong 10 phút cuối và để lọt lưới tới 2 bàn.</p>\r\n\r\n<p style=\"font-family:Arial, Helvetica, sans-serif; line-height:1.4; color:rgb(0, 0, 0); text-align:center\"><img alt=\"Chelsea thắng như chẻ tre: Hay không bằng... may - 1\" class=\"news-image\" src=\"http://image.24h.com.vn/upload/3-2016/images/2016-08-22/1471870540-collage_photocat.jpg\" style=\"border: 0px; max-width: 400px;\" /></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 255); font-style: italic; text-align: center;\">Toàn thắng hai trận, nhưng <a class=\"TextlinkBaiviet\" href=\"http://www.24h.com.vn/chelsea-p723c48.html\" style=\"text-decoration: none; color: rgb(0, 0, 255);\" title=\"Chelsea\">Chelsea</a> vẫn gặp rất nhiều bất ổn ở hàng công lẫn hàng thủ</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Có thể nhận thấy, những điều chỉnh mang tính cách mạng của HLV Antonio Conte hồi đầu mùa đã không phát huy hiệu quả như mong đợi, dẫn đến tình trạng hàng công thi đấu bế tắc, còn hàng thủ lỏng lẻo, mong manh đến bất ngờ.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Oscar, được chiến lược gia người Italia tin tưởng ở vị trí “số 10” thiếu sự đột biến, sáng tạo. Pedro Rodriguez không khá hơn là bao không hoàn thành nhiệm vụ với vô số pha đi bóng, tạt bóng như “húc đầu vào đá”. Lần hiếm hoi đá chính (thay Wilian) của cựu tiền vệ<a class=\"TextlinkBaiviet\" href=\"http://www.24h.com.vn/barca-p724c48.html\" style=\"text-decoration: none; color: rgb(0, 0, 255);\" title=\"Barca\">Barca</a> ở trận gặp Watford đã trở thành ác mộng.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Phong độ mờ nhạt của hai đồng đội khiến những nỗ lực của Eden Hazard chỉ như \"muối bỏ biển\".</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Phía dưới, cặp trung vệ Terry - Cahill tỏ ra đuối sức khi phải đối mặt với những tiền đạo to khỏe bên phía đối phương, còn hậu vệ phải Ivanovic hoàn toàn \"vô dụng\" cả trong tấn công lẫn phòng ngự (đó là lý do tại sao Conte liên tục thúc giục BLĐ chiêu mộ một cái tên đẳng cấp như Kalidou Koulibaly hay Giorgio Chiellini).</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Trước Watford, Conte đã thực hiện hai điều chỉnh nhân sự chính xác khi tung Michy Batshuayi và Cesc Fabregas vào vào sân, để rồi họ chính là chìa khóa giúp <em>Chelsea</em>lội ngược dòng ngoạn mục. </p>\r\n\r\n<p style=\"font-family:Arial, Helvetica, sans-serif; line-height:1.4; color:rgb(0, 0, 0); text-align:center\"><img alt=\"Chelsea thắng như chẻ tre: Hay không bằng... may - 2\" class=\"news-image\" src=\"http://image.24h.com.vn/upload/3-2016/images/2016-08-22/1471870683-36f8186300000578-3727866-cesc_fabregas_being_given_his_instructions_by_antonio_conte_as_t-m-18_1470592801675.jpg\" style=\"border: 0px; max-width: 400px;\" /></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 255); font-style: italic; text-align: center;\">Conte đang mắc sai lầm trong việc lựa chọn nhân sự</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Trong đó, chỉ cần 15 phút xuất hiện, Fabregas đã gây ấn tượng mạnh nhờ khả năng phân phối bóng cùng pha kiến tạo đẳng cấp cho Diego Costa ấn định chiến thắng 2-1.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Tiền vệ 29 tuổi vốn không nằm trong kế hoạch của Conte hồi đầu mùa, thậm chí đã rục rịch tìm kiếm bến đỗ mới, việc anh được tung vào sân chỉ vì đội bóng lâm nguy và cần sự thay đổi.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Thế nhưng sau màn trình diễn đỉnh cao vừa qua, Fabregas đang chứng minh cho Conte thấy ông  thầy đã sai lầm. Anh xứng đáng với suất đá chính, chứ không phải băng ghế dự bị. </p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Nếu phải tìm ra điểm sáng hiếm hoi, có lẽ đó là Diego Costa - người trực tiếp mang về hai chiến thắng cho Chelsea với những bàn thắng ở những phút cuối trận. Cũng như Fabregas, tiền đạo người TBN thể hiện phong độ hoàn toàn trái ngược với mùa giải trước.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Hè này, nhiều tin đồn cho rằng Costa sẽ quay trở lại đầu quân cho Atletico Madrid, nhưng rồi anh vẫn ở lại để đáp lại sự tin tưởng của Conte.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Mùa giải vẫn còn rất dài, vì vậy còn quá sớm để đánh giá về thực lực của <u>Chelsea </u>lẫn Conte. Vấn đề ở chỗ, chiến lược gia 47 tuổi sẽ tiếp tục kiên định với lập trường riêng hay chấp nhận thay đổi, mà những câu hỏi về hàng thủ, về Fabregas đang chờ ông tìm ra lời giải.   </p>\r\n', '', '', '', '', '', '', '', '', 1, 1, 1471952707, 1535015260, 0),
(75, 0, 0, 0, 0, 'tintuc', 1, '57407-5332.jpg', '57407-5332_290x290.jpg', 'Mourinho không về Liga, chê thiếu tính cạnh tranh', '', 'mourinho-khong-ve-liga-che-thieu-tinh-canh-tranh', '', '', '', 0, 0, 0, 0, 'Jose Mourinho tiết lộ ông từ chối cơ hội quay lại Italia và Tây Ban Nha để được làm việc ở một Premier League giàu tính cạnh tranh giữa các CLB hơn.', '<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\"><strong>Jose Mourinho</strong> mới đây đã tiết lộ lý do vì sao ông đã từ chối cơ hội trở lại làm việc tại Tây Ban Nha và Italia để ở lại Premier League. Mourinho nhận việc tại <a class=\"TextlinkBaiviet\" href=\"http://www.24h.com.vn/manchester-united-p721c48.html\" style=\"text-decoration: none; color: rgb(0, 0, 255);\" title=\"Manchester United\">Manchester United</a>mùa hè năm nay, nửa năm sau khi ông bị <a class=\"TextlinkBaiviet\" href=\"http://www.24h.com.vn/chelsea-p723c48.html\" style=\"text-decoration: none; color: rgb(0, 0, 255);\" title=\"Chelsea\">Chelsea</a> sa thải.</p>\r\n\r\n<p style=\"font-family:Arial, Helvetica, sans-serif; line-height:1.4; color:rgb(0, 0, 0); text-align:center\"><img alt=\"Mourinho không về Liga, chê thiếu tính cạnh tranh - 1\" class=\"news-image\" src=\"http://image.24h.com.vn/upload/3-2016/images/2016-08-23/1471887259-376892fc00000578-3752877-image-m-51_1471865471885-500.jpg\" style=\"border: 0px; max-width: 400px; width: 500px; height: 335px;\" /></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 255); font-style: italic; text-align: center;\">Jose Mourinho</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Trong thời gian thất nghiệp nửa đầu năm nay, báo giới TBN đã tiết lộ rằng Jose Mourinho đã được mời trở lại làm việc cho <a class=\"TextlinkBaiviet\" href=\"http://www.24h.com.vn/real-madrid-p725c48.html\" style=\"text-decoration: none; color: rgb(0, 0, 255);\" title=\"Real Madrid\">Real Madrid</a> bởi chủ tịch Florentino Perez. Tuy nhiên HLV tạm quyền Zinedine Zidane, người lên thay Rafael Benitez, đã làm việc quá tốt, đưa Real về nhì La Liga với cách biệt chỉ 1 điểm sau Barca, đồng thời đoạt chức vô địch Champions League.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Mourinho mới đây cho biết ông đã từ chối Real bởi tính chất cạnh tranh của giải La Liga không cao, trong khi tính chất của Premier League đòi hỏi nhiều nỗ lực hơn và vì thế cũng khiến ông bị hấp dẫn hơn.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Trả lời phỏng vấn cho tờ Gazzetta dello Sport, Mourinho nói: “Tôi có cơ hội quay lại Italia hoặc Tây Ban Nha, nhưng Premier League rất đặc biệt. Ở một số quốc gia, những đội bóng lớn luôn muốn duy trì vị thế của mình trong khi khiến đối thủ yếu đi. Điều ngược lại xảy ra ở Anh. Họ muốn tất cả các CLB ở cùng giải đấu có cơ hội ngang nhau”.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Mourinho đã có khởi đầu tốt với <em>MU</em>, giành chiến thắng trong 2 vòng đấu đầu tiên của mùa giải mới. Mặc dù Mourinho muốn thắng mọi trận đấu, ông cũng đồng thời nhận thức rằng đó là một kỳ vọng không thực tế.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">“Đôi lúc tôi hơi ngu ngốc trong cách đặt mục tiêu, đó là muốn thắng mọi trận đấu và mọi giải đấu, bởi điều đó là không thể. Điều chúng tôi sẽ làm là bắt đầu mùa giải này với tâm lý đá để chiến thắng mỗi trận, và rồi chờ xem điều đó sẽ đưa chúng tôi tới đâu”.</p>\r\n\r\n<p style=\"font-family:Arial, Helvetica, sans-serif; line-height:1.4; color:rgb(0, 0, 0); text-align:center\"><img alt=\"Mourinho không về Liga, chê thiếu tính cạnh tranh - 2\" class=\"news-image\" src=\"http://image.24h.com.vn/upload/3-2016/images/2016-08-23/1471887297-960-500.jpg\" style=\"border: 0px; max-width: 400px; width: 500px; height: 323px;\" /></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 255); font-style: italic; text-align: center;\">Cameron Borthwick-Jackson</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Sự có mặt của Mourinho ở MU đã dấy lên một số nghi ngại rằng ông sẽ không trọng dụng các ngôi sao trẻ mới nổi của CLB. Mới đây “Người đặc biệt” đã quyết định cho hậu vệ Cameron Borthwick-Jackson gia nhập Wolverhampton dưới dạng cho mượn. Tuy nhiên có vẻ Mourinho kỳ vọng lớn vào hậu vệ này và xem việc cho anh được Wolves mượn là cần thiết.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Trả lời cho tờ Manchester Evening News sau khi hoàn tất thỏa thuận cho mượn, Borthwick-Jackson cho biết: “<u>Mourinho</u> nói với tôi ông ấy tin tôi có tương lai lâu dài ở CLB, do vậy tôi cần có kinh nghiệm để được đá chính. Mục tiêu của tôi là chơi càng nhiều trận càng tốt để có kinh nghiệm thi đấu, trước khi trở lại và tranh chấp một suất thi đấu ở CLB”.</p>\r\n', '', '', '', '', '', '', '', '', 1, 1, 1471952765, 1535015228, 0),
(76, 0, 0, 0, 0, 'tintuc', 1, '20228-9082.jpg', '20228-9082_290x290.jpg', 'Đoạt HCV Olympic, Neymar hoãn về Barca tới tháng 9', '', 'doat-hcv-olympic-neymar-hoan-ve-barca-toi-thang-9', '', '', '', 0, 0, 0, 0, 'Neymar sau khi giành HCV Olympic cho bóng đá Brazil sẽ ở lại quê nhà và chỉ trở lại Barca vào tháng 9.', '<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\"><strong>Neymar</strong> đã có một mùa hè trọn vẹn, khi anh cùng đội tuyển Olympic Brazil đoạt HCV Olympic 2016. Anh cùng các đồng đội đi tới chung kết và đánh bại Olympic Đức trong một trận đấu mà <a class=\"TextlinkBaiviet\" href=\"http://www.24h.com.vn/neymar-p359c48.html\" style=\"text-decoration: none; color: rgb(0, 0, 255);\" title=\"Neymar\">Neymar</a> ghi bàn cho Brazil và thực hiện cú sút luân lưu quyết định.</p>\r\n\r\n<p style=\"font-family:Arial, Helvetica, sans-serif; line-height:1.4; color:rgb(0, 0, 0); text-align:center\"><img alt=\"Đoạt HCV Olympic, Neymar hoãn về Barca tới tháng 9 - 1\" class=\"news-image\" src=\"http://image.24h.com.vn/upload/3-2016/images/2016-08-22/1471882808-ney-gano-oro-olimpico-1471864648814-500.jpg\" style=\"border: 0px; max-width: 400px; width: 500px; height: 311px;\" /></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 255); font-style: italic; text-align: center;\">Neymar cùng Olympic Brazil đoạt HCV tại Rio</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Neymar đã phải bỏ Copa America 2016 để phục vụ cho mục tiêu huy chương Vàng Olympic, thứ duy nhất mà bóng đá nam Brazil còn thiếu. Nay đã là nửa cuối tháng 8, và Neymar vẫn còn lâng lâng trong chiến thắng giữa lúc các đồng đội anh ở Barcelona đã chuẩn bị hoàn chỉnh và bước vào chiến dịch bảo vệ ngôi vô địch La Liga.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Tờ Sport (TBN) cho biết <em>Neymar</em> và HLV trưởng Luis Enrique mới đây đã có cuộc trò chuyện điện thoại với nhau. Enrique đã đưa ra một giải pháp làm hài lòng Neymar, đó là cho anh thêm thời gian ở lại Brazil nghỉ ngơi. Vừa dứt Olympic, Neymar đã được triệu tập để chuẩn bị cho các trận đấu tiếp theo của vòng loại World Cup 2018 khu vực Nam Mỹ, và Neymar sẽ không phải về Barcelona vội để tiết kiệm thời gian di chuyển.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Lần cuối cùng Neymar có mặt ở Barcelona đã là từ tận ngày 23/5, ngày mà Barca ăn mừng mùa giải kết thúc thắng lợi. Neymar sau đó lên máy bay đi nghỉ ở đảo Ibiza trước khi tới Mỹ, đá vui vài trận đấu từ thiện trước khi về Brazil chuẩn bị cho Olympic. Trong lúc này, Barca và người đại diện của Neymar đã hoàn tất việc gia hạn hợp đồng tới năm 2021 một cách êm thấm.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Theo lịch, Neymar sẽ trở lại Barcelona vào ngày 8/9, mà đó là sớm nhất có thể, tức Neymar sẽ trở lại thành phố sau 107 ngày. Trận đấu đầu tiên Neymar có thể thi đấu cho Barca là trước Alaves, nhưng nếu Neymar quay về vào ngày 8/9 thì trận gặp Alaves diễn ra sau đó chỉ 2 ngày. HLV Luis Enrique có lẽ sẽ không để Neymar ra sân ngay.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Dẫu vậy ngoài khả năng nghỉ trận Alaves, <u>Neymar</u> sẽ chỉ mất thêm 1 trận nữa là chuyến làm khách của Barca đến sân San Mames của Athletic Bilbao (1h15 rạng sáng ngày 29/8 – giờ Việt Nam). Barca đang thi đấu khá tốt với bộ ba tiền đạo <a class=\"TextlinkBaiviet\" href=\"http://www.24h.com.vn/lionel-messi-p356c48.html\" style=\"text-decoration: none; color: rgb(0, 0, 255);\" title=\"Messi\">Messi</a> – <a class=\"TextlinkBaiviet\" href=\"http://www.24h.com.vn/luis-suarez-p358c48.html\" style=\"text-decoration: none; color: rgb(0, 0, 255);\" title=\"Suarez\">Suarez</a> – Turan, do vậy họ có thể chờ được sự trở lại của Neymar thêm vài tuần lễ nữa.</p>\r\n', '', '', '', '', '', '', '', '', 1, 1, 1471952830, 1535015222, 0),
(78, 0, 0, 0, 0, 'tintuc', 1, '13478-133.jpg', '13478-133_290x290.jpg', 'Mourinho đang “Man City hóa” MU, nhưng đã sao?', '', 'mourinho-dang-man-city-hoa-mu-nhung-da-sao', '', '', '', 0, 0, 0, 0, 'Giữa một rừng những bài báo tâng bốc, những lời tán dương khúc dạo đầu mãnh liệt của Manchester United, người ta vẫn không thể lãng quên một chi tiết: trận thắng Southampton ở vòng 2 Premier League là lần đầu tiên sau 29 năm “Quỷ đỏ” thi đấu trên sân nhà mà thiếu vắng một người, Ryan Giggs.', '<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\"><strong>MU đang đổi thay</strong></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Giggs gia nhập lò đào tạo trẻ trứ danh của United vào ngày 29/11/1987 khi còn học trung học. Trước đó vài ngày, chàng thiếu niên người xứ Wales đã thăm sân Old Trafford và xem trận đấu MU hòa Liverpool 1-1.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Kể từ ấy, Giggs đã trở thành một phần lịch sử của “Quỷ đỏ”. Anh lên đội 1 năm 1991, giành 13 chức vô địch <a class=\"TextlinkBaiviet\" href=\"http://www.24h.com.vn/premier-league-2016-2017-c48e2367.html\" style=\"text-decoration: none; color: rgb(0, 0, 255);\" title=\"Premier League\">Premier League</a> và 2 danh hiệu Champions League. Anh giải nghệ năm 2014 để sắm vai HLV trưởng tạm quyền trước khi làm trợ lý cho HLV David Moyes rồi Van Gaal. Hè này Giggs quyết định ra đi và một phần lịch sử khép lại.</p>\r\n\r\n<p style=\"font-family:Arial, Helvetica, sans-serif; line-height:1.4; color:rgb(0, 0, 0); text-align:center\"><img alt=\"Mourinho đang “Man City hóa” MU, nhưng đã sao? - 1\" class=\"news-image\" src=\"http://image.24h.com.vn/upload/3-2016/images/2016-08-23/1471921209-mou-1.jpg\" style=\"border: 0px; max-width: 400px;\" /></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 255); font-style: italic; text-align: center;\"> Lần đầu tiên sau 29 năm, “Quỷ đỏ” thi đấu trên sân nhà mà thiếu vắng Ryan Giggs</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Men say chiến thắng đến từ triều đại mới của Mourinho vẫn chưa thể xua đi cảm giác chua xót trong lòng những CĐV trung thành khi chứng kiến các ngôi sao trẻ lũ lượt ra đi: McNair, Varela, Januzaj, Wilson và sắp tới có thể thêm viên ngọc sáng giá nhất Andreas Pereira.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Hãy xem những gương mặt nào đang gây ấn tượng mạnh mẽ nhất. Đó là Eric Bailly, Paul Pogba, và Zlatan Ibrahimovic. 3 cái tên ấy dàn đều 3 tuyến và đều là những tân binh được Mourinho đưa về. Sân Old Trafford đang chứng kiến làn sóng các “Galactico” thay thế những gương mặt “home-grown” (các cầu thủ “cây nhà lá vườn”). MU đang dùng tiền mua danh hiệu, hệt cái cách họ từng mai mỉa Man City!</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">MU dưới thời Sir Alex Ferguson chưa bao giờ là kẻ đi mua chiến thắng. Quỹ lương của họ chỉ đứng thứ 3 ở giải Ngoại hạng, thấp hơn 2 gã nhà giàu Man City và <a class=\"TextlinkBaiviet\" href=\"http://www.24h.com.vn/chelsea-p723c48.html\" style=\"text-decoration: none; color: rgb(0, 0, 255);\" title=\"Chelsea\">Chelsea</a>. Mùa bóng 2011-12, tiền trả lương chỉ chiếm 51% doanh số của “Quỷ đỏ” - tỷ lệ thấp thứ hai trong 20 đội ở Premier League. Ở thời điểm Sir Alex giải nghệ thì 4 trong 5 bản hợp đồng đắt giá nhất lịch sử MU được thực hiện trước khi nhà Glazer tiếp quản.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\"><strong>Cầu thủ giỏi phải hưởng lương cao</strong></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">3 năm sau khi Sir Alex rút lui, MU đã hoàn toàn đổi khác. Kỷ lục chuyển nhượng của họ đã bị phá vỡ tới 3 lần. Quỹ lương của MU cũng phình to nhất Premiership sau khi họ dùng lương khủng để trói chân Rooney và mời gọi các ngôi sao Pogba, Ibra về Old Trafford.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">MU đã đổi thay nhưng đó là sự đổi thay không thể cưỡng lại được trong dòng chảy tự nhiên của bóng đá. Những người như Sir Alex cả trăm năm mới xuất hiện một lần và MU không thể bám mãi vào một mô hình cũ kỹ. Thất bại với David Moyes đã buộc họ phải nhìn nhận lại cách thức làm bóng đá của mình.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Từ trước đến nay chúng ta vẫn thường giữ một quan điểm (hoặc một định kiến) rằng bóng đá đích thực không nên bị thương mại hóa, và rằng các cầu thủ không nên được trả quá nhiều tiền.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Quan điểm/định kiến ấy liệu có chính xác hay không? Trên hết, nó có công bằng hay không, khi mà các diễn viên Hollywood có thể kiếm vài chục triệu USD tiền cát-xê cho một bộ phim, hay tay đấm như Floyd Mayweather bỏ túi ngót trăm triệu USD mỗi lần thượng đài?</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Giữa Mayweather và Ibrahimovic ai tài năng hơn, ai khổ luyện hơn? Chưa biết được. Nhưng có một điều chắc chắn, mỗi trận đấu của Mayweather chỉ phục vụ vài nghìn khán giả và khoảng trăm triệu người xem qua truyền hình, trong khi Ibrahimovic phục vụ 76.000 khán giả ở Old Trafford và hàng tỷ khán giả xem qua tivi.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Dĩ nhiên, sự phát triển nóng của những đội như MU luôn dấy lên lo ngại. Từ 8 năm trước, khi MU gặp Chelsea ở chung kết Champions League thì hai đội đã nợ tổng cộng 3 tỷ USD. Bởi thế mà ông Michel Platini khi chưa bị đình chỉ chức chủ tịch UEFA đã “đẻ” ra cái gọi là Luật Công bằng tài chính (UEFA Financial Fair Play - gọi tắt là FFP) để ngăn chặn.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Tuy nhiên người ta chứng minh được rằng FFP đi ngược lại các quy luật của kinh tế thị trường và bởi thế nó “chết yểu”. Hiện chưa rõ khi nào FFP được thực thi hoàn toàn, trong khi tác giả Platini thì đã bị “rút thẻ đỏ”.</p>\r\n\r\n<p style=\"font-family:Arial, Helvetica, sans-serif; line-height:1.4; color:rgb(0, 0, 0); text-align:center\"><img alt=\"Mourinho đang “Man City hóa” MU, nhưng đã sao? - 2\" class=\"news-image\" src=\"http://image.24h.com.vn/upload/3-2016/images/2016-08-23/1471921209-mou-3.jpg\" style=\"border: 0px; max-width: 400px;\" /></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 255); font-style: italic; text-align: center;\">Các ngôi sao của MU khiến giải đấu hấp dẫn hơn</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\"><strong>Giải Ngoại hạng hấp dẫn nhờ MU</strong></p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Những người như Michel Platini ghét sự hào nhoáng của giải Ngoại hạng. Họ lo ngại về việc quá nửa số CLB Premier League đã sang tay ông chủ ngoại - những người có thể bỏ cuộc bất kỳ lúc nào. Họ rùng mình khi thấy các CLB Anh quẳng số tiền không thể tin nổi để mua những cầu thủ không tương xứng...</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Nhưng có một điều mà Platini không hiểu được, đó là: khán giả thích điều đó, đặc biệt là khán giả ngoại quốc. Họ thích sự hào nhoáng của Premiership. Họ thích những ông chủ hào phóng. Họ thích nụ cười của Abramovich, thích sự bí hiểm của các ông chủ Man United và Man City. Họ hứng thú với các ngôi sao hưởng lương ngất ngưởng...</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Trong giai đoạn 2010-2013, Premier League đã kiếm được 1,44 tỷ bảng từ bán bản quyền truyền hình ra nước ngoài, cao gấp 4 lần La Liga, gấp 6 lần <a class=\"TextlinkBaiviet\" href=\"http://www.24h.com.vn/bong-da-y-c150.html\" style=\"text-decoration: none; color: rgb(0, 0, 255);\" title=\"Serie A\">Serie A</a>, gấp 14 lần Bundesliga. MU đâu có điên! 19 đội còn lại đâu có điên!</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Về phía người Anh, họ phản ứng ra sao khi thấy các đội bóng lần lượt bị sang tay các ông chủ ngoại quốc? Họ không quá bận lòng bởi Rolls-Royce, một niềm tự hào quốc gia cũng bị bán đó thôi.</p>\r\n\r\n<p style=\"font-family: Arial, Helvetica, sans-serif; line-height: 1.4; color: rgb(0, 0, 0); text-align: justify;\">Suy cho cùng thì mục đích lớn nhất của bóng đá là để giải trí. Hãy cứ tận hưởng những bàn thắng của Ibra, những pha đi bóng ảo diệu của Pogba hay những cú tắc của Bailly... MU có bị “Man City hóa” cũng không phải chuyện hệ trọng nếu đó là một MU đẹp mắt và biết chiến thắng!</p>\r\n', '', '', '', '', '', '', '', '', 1, 1, 1471952948, 1535015217, 0),
(80, 0, 0, 0, 0, 'travel', 1, 'travel001-5899.png', 'travel001-5899_372x270.png', 'Dự án bất động sản quận 7', '', 'du-an-bat-dong-san-quan-7', '', '', '', 0, 0, 0, 0, 'Hầu hết mỗi công ty đều có bài giới thiệu về doanh nghiệp mình, nhưng để có  được một bài giới thiệu đầy đủ, hiệu quả để chinh phục được khách hàng cũng như đối tác thì không phải doanh nghiệp nào cũng làm được.', '', '', '', '', '', '', '', '', '', 1, 1, 1501013690, 1501013703, 0),
