(3, '', 'tuyendung', '', '', '', '<p class=\"Normal\">V&agrave;o s&acirc;n với đội h&igrave;nh gần như mạnh nhất, Đức thoải m&aacute;i chiếm ưu thế trước chủ nh&agrave; Ireland. Nhưng điều g&acirc;y thất vọng l&agrave; c&aacute;c cầu thủ mang danh đương kim v&ocirc; địch World Cup li&ecirc;n tục bỏ lỡ cơ hội.</p>\r\n\r\n<p class=\"Normal\">Ozil, Gundogan v&agrave; Reus c&oacute; ba t&igrave;nh huống dứt điểm từ vị tr&iacute; trống trải trước khung th&agrave;nh thủ m&ocirc;n Shay Given, nhưng đều kh&ocirc;ng ho&agrave;n th&agrave;nh nhiệm vụ. Ng&ocirc;i sao của CLB Arsenal cũng c&oacute; một lần đưa b&oacute;ng v&agrave;o lưới Ireland, nhưng kh&ocirc;ng được c&ocirc;ng nhận b&agrave;n thắng do lỗi việt vị.</p>\r\n', '', '', '', '0', '0', '0', 'Tuyển nhân viên', 'Tuyển nhân viên,Tuyển nhân viên,Tuyển nhân viên', 'Tuyển nhân viên,Tuyển nhân viên,Tuyển nhân viên,Tuyển nhân viên', '', '', 1, 0, 1444362420, 0),
